glsl3.frag:
  precision highp float;
  vec4 CCSampleWithAlphaSeparated(sampler2D tex, vec2 uv) {
  #if CC_USE_EMBEDDED_ALPHA
    return vec4(texture(tex, uv).rgb, texture(tex, uv + vec2(0.0, 0.5)).r);
  #else
    return texture(tex, uv);
  #endif
  }
  #if USE_ALPHA_TEST
    layout(std140) uniform ALPHA_TEST_DATA {
      float alphaThreshold;
    };
  #endif
  void ALPHA_TEST (in vec4 color) {
    #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
    #endif
  }
  void ALPHA_TEST (in float alpha) {
    #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
    #endif
  }
  in vec4 color;
  #define AA 0.02
  #define PI2 6.28318530718
  #define RADIUS 0.4
  #define THICKNESS 0.05
  layout(std140) uniform Constant {
    float rate;
  };
  #if USE_TEXTURE
    in vec2 uv0;
    uniform sampler2D cc_spriteTexture;
  #endif
float DrawCircle(vec2 uv, vec2 p, float r)
{
    uv += p;
    return smoothstep(r+AA, r-AA, length(uv));
}
  vec2 RotationUV(vec2 uv, float d)
{
    float s = sin(d);
    float c = cos(d);
    mat2 rotMatrix = mat2(c, -s, s, c);
    return uv * rotMatrix;
}
  vec4 frag () {
    vec4 o = vec4(1, 1, 1, 1);
    #if USE_TEXTURE
      o *= CCSampleWithAlphaSeparated(cc_spriteTexture, uv0);
      #if IS_GRAY
        float gray  = 0.2126 * o.r + 0.7152 * o.g + 0.0722 * o.b;
        o.r = o.g = o.b = gray;
      #endif
    #endif
    vec2 uv = 0.5-uv0;
    float circle = smoothstep(RADIUS+AA, RADIUS-AA, abs(length(uv) - RADIUS) + RADIUS - THICKNESS);
    float radial = (atan(uv.x, uv.y) / 3.14159265359 * 0.5);
    float time = rate;
    radial += time;
    circle *= step(fract(radial), fract(time));
    circle = max(circle, DrawCircle(uv, vec2(0,-RADIUS), THICKNESS));
    circle = max(circle, DrawCircle(RotationUV(vec2(-uv.x, uv.y), PI2 * time), vec2(0,-RADIUS), THICKNESS));
    o *= color;
    o *= circle;
    ALPHA_TEST(o);
    return o;
  }
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }

